{
  "text": "A nuclear explosion releases a tremendous amount of energy, but when compared to the enormous rotational energy and angular momentum of the Earth, its effect is negligible. In theory, any force applied to the Earth—if it were directed in a completely asymmetric way—could alter its rotation. However, the energy associated with even the largest nuclear explosions is many orders of magnitude too small to produce any measurable change in the Earth's rotation.

For some perspective, the Earth has a mass of about 6 × 10^24 kilograms and a moment of inertia on the order of 8 × 10^37 kg·m², resulting in a huge amount of angular momentum as it spins. Any change in the rotational speed would require an immense torque or an external force that is similarly enormous in magnitude. The energy released by a nuclear explosion, though enormous on a human scale (typically measured in megatons of TNT, where 1 megaton is roughly 4 × 10^15 joules), is trivial when compared to the energy and angular momentum of the Earth.

Thus, while it is theoretically true that an external impulse (force applied off-center) could change an object's rotation, the enormous scale of Earth means that a nuclear explosion—even a very large one—would not be capable of noticeably altering its rotation. Any such effect would be utterly minuscule and drowned out by other effects such as seismic activity and tidal friction."
}

